In C, you can terminate a program using the `exit()` function or the `return` statement in the `main()` function.

1. `exit()`: This function causes immediate termination of the program. It takes an integer argument, which is the exit status of the program.

```c
#include <stdlib.h>

int main() {
    // Your code here
    exit(0);  // Exit status 0 means successful termination
    return 0;  // This is equivalent to exit(0)
}
```

2. `return` statement in `main()`: If you use the `return` statement in the `main()` function, it will also terminate the program. The value returned by the `main()` function is the exit status of the program.

```c
#include <stdio.h>

int main() {
    // Your code here
    return 0;  // Exit status 0 means successful termination
}
```

